      screen: Medicines,
      navigationOptions: {
        headerShown: 'true',

      }
    },
    Grooming: {
      screen: Grooming,
      navigationOptions: {
        headerShown: 'true',

      }
    },
    AccessoriesScreenHome: {
      screen: AccessoriesScreenHome,
      navigationOptions: {
        headerShown: 'true',

      }
    },
    Cities: {
      screen: Cities,
      navigationOptions: {
        headerShown: 'true',

      }
    },
    DetailScreen: {
      screen: DetailScreen,
      navigationOptions: {
        headerShown: 'true',
       // title: 'Pets Bazar' 
      }
    },
    MedicinesDetailScreen: {
      screen: MedicinesDetailScreen,
      navigationOptions: {
        headerShown: 'true',
       // title: 'Pets Bazar' 
