    },
    Sellnow: {
      screen: Sellnow,
      navigationOptions: {
        headerShown: 'true',
       // title: 'Pets Bazar' 
      }

  },
  Contactus: {
    screen: Contactus,
    navigationOptions: {
      headerShown: 'true',
     // title: 'Pets Bazar' 
    }
  },
  VeterinaryScreen: {
    screen: VeterinaryScreen,
    navigationOptions: {
      headerShown: 'true',

    }
  }


